import React, {Component} from 'react';
import './css/main.css';
import './css/util.css';
import './signup.css';
import Sketch from "react-p5";
const axios = require('axios');
let video;
export class Signup extends Component {
	constructor(props){
		super(props);
		this.state = {
			signup : true
		};
	}
	setup(p5, canvasParentRef) {
        p5.noCanvas();
        video = p5.createCapture(p5.VIDEO);
        const v = document.querySelector("video");
        let st = "position: absolute; top: 355px;left:880px;"
        v.setAttribute("style", st);
    }

    setup2(){
    	const button = document.getElementById('submit');
        button.addEventListener('click', async event => {
          const mood = document.getElementById('mood').value;
		  const mood2 = document.getElementById('mood2').value;
          video.loadPixels();
          console.log(video.canvas);
          const image64 = video.canvas.toDataURL();
          const data = { mood, image64 };
          const options = {
            method: 'POST',
            headers: {
              'Content-Type': 'application/json'
            },
            body: JSON.stringify(data)
          };
          console.log(image64);
          const response = await axios.post('http://localhost:5000/register', {'image64':image64, 'username':mood, 'password':mood2});
          if(response.status==200){
		  		const tracks = document.querySelector("video").srcObject.getTracks();
		  		tracks.forEach(function(track) {
    				track.stop();
  				});
		  	};
          	this.props.backhome();
          }
        );
    }
    logout(){
    	const tracks = document.querySelector("video").srcObject.getTracks();
		  	tracks.forEach(function(track) {
    				track.stop();
  			});
    	this.props.backhome();
    }

	render(){

		let signup = (
				<div>
					<div className="limiter">
						<div className="container-login100">
							<div className="wrap-login100 p-l-110 p-r-110 p-t-62 p-b-33">
									<span className="login100-form-title p-b-53">
										One time Login
									</span>
									<div className="p-t-31 p-b-9">
										<span className="txt1">
											PSID
										</span>
									</div>
									<div className="wrap-input100 validate-input" data-validate = "username is required">
										<input id="mood" className="input100" type="text" name="username" />
										<span className="focus-input100"></span>
									</div>
									<input/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<br/><br/>
									<div className="p-t-31 p-b-9">
										<span className="txt2">
											Password
										</span>
									</div>
									<div className="wrap-input100 validate-input" data-validate = "Password is required">
										<input id="mood2" className="input100" type="password" name="password" />
										<span className="focus-input100"></span>
									</div>
									<input/>

									{this.state.signup?<Sketch id="s" setup={this.setup} draw={this.draw}/>:''}
									
									<div className="container-login100-form-btn m-t-17">
										<button id="submit" onClick={this.setup2.bind(this)} className="login100-form-btn">
											Sign Up
										</button>
									</div>
									<div className="container-login100-form-btn m-t-17">
										<button onClick={this.logout.bind(this)} className="login100-form-btn">
											Back!
										</button>
									</div>						
							</div>
						</div>
					</div>
					<div id="dropDownSelect1"></div>
				</div>
		)
    	return (<div >
    		{ signup }
    		</div>
		)
	}
}
export default Signup;
